var title_f22_37_23120="Increasing plasma cholesterol and coronary risk";
var content_f22_37_23120=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F60146%7ECARD%2F50334%7ECARD%2F78556&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F60146%7ECARD%2F50334%7ECARD%2F78556&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Association of increasing plasma cholesterol and coronary risk",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 364px; height: 238px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Relation between plasma cholesterol concentration and six-year coronary heart disease risk in 361,662 men (ages 35 to 57) screened during the MRFIT study. There is a continuous, positive, graded correlation between the plasma cholesterol concentration and coronary risk. To convert plasma cholesterol to mmol/L, divide by 38.5.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from: Stamler J, Wentworth D, Neaton JD. JAMA 1986; 256:2823.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 548px\">",
"   <div class=\"ttl\">",
"    Plasma cholesterol and cardiovascular mortality",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 528px; height: 256px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Relation between the baseline plasma cholesterol concentration and ten-year cardiovascular death rate in patients without and with manifestations of coronary heart disease (CHD) in the Lipid Research Council study. Cumulative death rates were increased at higher plasma cholesterol levels in both groups, but the effect was more pronounced in patients with preexisting CHD.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from Pekannen J, Linn S, Heiss G, et al. N Engl J Med 1990; 322:1700.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Death from coronary heart disease",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 322px; height: 422px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    There is a direct relationship between cholesterol level and mortality among patients without coronary heart disease (CHD) and those with CHD and angina or myocardial infarction.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from Rosengren, A, Hagman, M, Wedel, H, et al. Eur Heart J 1997; 18:754.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
