" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Planter fascia stretching exercise",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 411px; height: 524px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Plantar fascia-stretching exercise. The patient crosses the affected leg over the contralateral leg. While placing the fingers across the base of the toes, the patient pulls the toes back toward the shin until he or she felt a stretch in the arch or plantar fascia. The patient confirms that the stretch is correct by palpating tension in the plantar fascia.",
