" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Leukocytoclastic vasculitis histology",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 360px; height: 246px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Skin biopsy from a patient with leukocytoclastic vasculitis showing striking mural fibrin deposition in a postcapillary venule and a concomitant angiocentric mixed neutrophilic and lymphocytic infiltrate. This pattern can be seen in a variety of disorders including hypersensitivity vasculitis, systemic lupus erythematosus, rheumatoid arthritis, mixed connective tissue disease, Sj&ouml;gren's syndrome, Behcet's disease, and relapsing polychondritis.",
